import React from 'react'

const Navbar = () => {
  return (
    <div className="bg-slate-800 h-16 px-16 items-center flex">
      <div className="space-x-4 ml-auto">
      <a className="hover:text-blue-700 text-base font-medium mx-2" href="/">Home</a>
      <a className="hover:text-blue-700 text-base font-medium mx-2" href="/">Profile</a>
      <a className="hover:text-blue-700 text-base font-medium mx-2" href="/">Logout</a>

      </div>
    </div>

  )
}

export default Navbar
